  return (<h1>Welcome! This page lists out schools, mascots, and locations</h1>)
}




class Schools extends React.Component 
<{name: string; school: string; city: string; state: string}>
{
  render() {
    const oneSchool = this.props;
    return (
      <div>
        <h2>Name: {oneSchool.school}</h2>
        <h3>Mascot: {oneSchool.name}</h3>
        <h3>Location: {oneSchool.city}, {oneSchool.state}</h3>
      </div>
    )
  }
}

function SchoolList(){
  return(
    <div>
      <Schools {...schoolinfo[3]}/>
      <School {...schoolinfo[4]}/>

    </div>
  )
}

export default App;
